import { useNavigate } from "react-router-dom";

function Homepage() {
  const navigate = useNavigate();

  function navigateToLost() {
    navigate("/lostpet");
  }

  function navigateToFound(){
    navigate("/foundpet")
  }

  function navigateToAdopt(){
    navigate("/adopt")
  }
  return (
    <div>
      <h1>
        Lost and Found is a website where you declare your lost pet or that you
        found a missing pet.
      </h1>
      <h2> Help us to help you into finding your lovely pet!</h2>
      <button onClick={navigateToLost}>i lost a pet</button>
      <br />
      <button onClick={navigateToFound}>I found a pet</button>
      <br />
      <button onClick={navigateToAdopt}>I want to adopt a pet</button>
    </div>
  );
}
export default Homepage;
